import React from 'react';
import Navbar from './Navbar.js';
import Product from './ProductCard.js';
import iphone from './resources/iphonex.png';
import logo from './logo.svg';
import nature from './resources/nature.jpg';
import './menu.css';

class Menu extends React.Component{
    render(){
        return(
            <div class="container" id="menu-div">
                <div >              
                    <div class="row">                                
                        <div class="col-md-4 mb-4">
                            <Product img={nature}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={logo}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={logo}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={logo}></Product>
                        </div>
                        <div class="col-md-4 mb-4">
                            <Product img={logo}></Product>
                        </div>
                        <div className="card">
              <div className="card-img" onMouseEnter={this.handleEnter.bind(this)}
                            onMouseLeave={this.handleLeave.bind(this)} >
                  <img src={this.props.img} className="card-img-top" alt="alt-image-cap" id="product-photo"/>  
                  {this.state.isHovered && (
                      <div className="card-img-overlay justify-content-between mt-5" id="">
                      <button className="btn btn-light rounded-circle mt-4" id="left-arrow"><i className="fas fa-arrow-left"></i></button>
                      <button className="btn btn-light rounded-circle mt-4" id="right-arrow"><i className="fas fa-arrow-right"></i></button>
                  </div>
                  )}
              </div>

              <div className="card-body d-flex flex-column">
                  <h5 className="card-title">6000 kr</h5>
                  <p className="card-text"><small className="text-muted">Bergen</small></p>
                  <p className="card-text">Pent brukt Iphone X. Kjopt in 2019. Ny pris: 2345 kr. Ma hentes.</p>
                  <div className="text-center mt-auto">
                      <button className="btn btn-primary w-40 me-3">Send Message     <i className="far fa-envelope"></i></button>
                      <button type="button" className="btn btn-outline-danger w-40">Add to Favorites <i className="fas fa-heart"></i></button>
                  </div>
              </div>
          </div>
                    
                    </div>
                </div>
            </div>       
        )
    }   
}

export default Menu;
